INSERT INTO `ahp_norm_base` VALUES (1,'AREA','采空区面积/矿山面积',NULL,'if(val<0.1){return 2.0;}else if(val<1){return 4.0;}else if(val<10){return 6.0;}else if(val<100){return 8.0;}else{return 10.0;}',NULL,'select  MINEGOAF_AREA/MINE_AREA   as AREA  from MINE_SURVEY_INFO b where 1=1',128),(2,'PIT_TONAGE','矿坑排水量/矿山面积',1,'if(val<0.1){return 2.0;}else if(val<1.0){return 4.0;}else if(val<10){return 6.0;}else if(val<100){return 8.0;}else{return 10.0;}',1.0000,'select  a.PIT_TONAGE/b.MINE_AREA   as PIT_TONAGE  from CEA_SURVEY_AQUIFER a,mine_survey_info b where  a.MINE_SURVEY_ID=b.MINE_SURVEY_ID and    1=1',128),(3,'WATER_DROP_AREA','地下水位下降面积/矿山面积',1,'if(val<0.1){return 2.0;}else if(val<1){return 4.0;}else if(val<10){return 6.0;}else if(val<100){return 8.0;}else{return 10.0;}',1.0000,'select  a.WATER_DROP_AREA/b.MINE_AREA   as WATER_DROP_AREA  from CEA_SURVEY_AQUIFER a,mine_survey_info b where  a.MINE_SURVEY_ID=b.MINE_SURVEY_ID and    1=1',128),(4,'MINEGOAF_AREA','地下水均衡破坏',1,'if(val < 0.001){\r\n		return 2.0;\r\n	}else if(val > 0.002 && val < 0.04){\r\n    return 2.0;\r\n  }else if(val > 0.04 && val < 0.1){\r\n    return 15.0;\r\n  }else{\r\n    return 11.0;\r\n  } ',1.0000,'SELECT MINEGOAF_AREA FROM mine_survey_info b WHERE 1=1 ',128),(5,'WASTE_SOLID','固体废弃物排放',1,'if(val<1){return 2.0;}else if(val<10){return 4.0;}else if(val<100){return 6.0;}else if(val<1000){return 8.0;}else{return 10.0;}',1.0000,'select a.TOTAL_STORE/b.MINE_AREA as WASTE_SOLID from CEA_WASTE_SOLID a,mine_survey_info b,CEA_SURVEY_WASTE c where a.WASTE_SURVEY_ID=c.WASTE_SURVEY_ID and b.MINE_SURVEY_ID = c.MINE_SURVEY_ID  and 1=1',128),(6,'WASTE_LIQUID','废水排放',1,'if(val<0.1){return 2.0;}else if(val<1){return 4.0;}else if(val<10){return 6.0;}else if(val<100){return 8.0;}else{return 10.0;}',1.0000,'select a.DISCHARGE/b.MINE_AREA as WASTE_LIQUID from CEA_WASTE_LIQUID a,mine_survey_info b,CEA_SURVEY_WASTE c where a.WASTE_SURVEY_ID=c.WASTE_SURVEY_ID and b.MINE_SURVEY_ID = c.MINE_SURVEY_ID  and 1=1',128),(7,'PLOWLAND_AREA','破坏耕地面积（公顷）',1,'if(val<0.2){return 2.0;}else if(val<0.5){return 4.0;}else if(val<1){return 6.0;}else if(val<2){return 8.0;}else{return 10.0;}',1.0000,'select PLOWLAND_AREA from CEA_LAND_DESTROY_TYPE a,mine_survey_info b,CEA_SURVEY_LAND_DESTROY c where a.LAND_DESTROY_ID=c.LAND_DESTROY_ID and b.MINE_SURVEY_ID = c.MINE_SURVEY_ID  and 1=1',128),(8,'LAND_DESTROY','土地损毁总面积/矿山面积',1,'if(val<1){return 2.0;}else if(val<10){return 4.0;}else if(val<100){return 6.0;}else if(val<1000){return 8.0;}else{return 10.0;}\r\n',1.0000,'select (a.PLOWLAND_AREA+a.WOODLAND_AREA+a.GRASS_AREA+a.GARDEN_AREA+a.BUILDING_AREA+a.OTHER_AREA)/b.MINE_AREA as LAND_DESTROY from CEA_LAND_DESTROY_TYPE a,mine_survey_info b,CEA_SURVEY_LAND_DESTROY c where a.LAND_DESTROY_ID=c.LAND_DESTROY_ID and b.MINE_SURVEY_ID = c.MINE_SURVEY_ID  and 1=1',128),(9,'DEATH_TOLL','死亡人数',1,'if(val==0){return 2;}else if(val<=2.0){return 4.0;}else if(val<=4.0){return 6.0;}else if(val<=9){return 8.0;}else{return 10.0;}',1.0000,'select a.DEAD_NUMBER+b.DEAD_NUMBER+c.DEAD_NUMBER+d.DEAD_NUBER  as DEATH_TOLL from CEA_SURVEY_DEBRIS a,CEA_SURVEY_SINK b,CEA_SURVEY_SLIDE c,CEA_SURVEY_COLLAPSE d where a.MINE_SURVEY_ID=b.MINE_SURVEY_ID and a.MINE_SURVEY_ID=c.MINE_SURVEY_ID and a.MINE_SURVEY_ID=d.MINE_SURVEY_ID and 1=1',128),(10,'ECONOMIC_LOSS','经济损失',1,'if(val<1){return 2.0;}else if(val<10){return 4.0;}else if(val<100){return 6.0;}else if(val<1000){return 8.0;}else{return 10.0;}',1.0000,'select a.DIRECT_LOSS+b.DIRECT_LOSS+c.DIRECT_LOSS+d.DIRECT_LOSS  as DEATH_TOLL from CEA_SURVEY_DEBRIS a,CEA_SURVEY_SINK b,CEA_SURVEY_SLIDE c,CEA_SURVEY_COLLAPSE d where a.MINE_SURVEY_ID=b.MINE_SURVEY_ID and a.MINE_SURVEY_ID=c.MINE_SURVEY_ID and a.MINE_SURVEY_ID=d.MINE_SURVEY_ID and 1=1',128),(11,'MINE_AREA','土地资源占用和破坏',1,'if(val < 0.02){\r\n		return 0;\r\n	}else if(val > 0.02 && val < 0.1){\r\n    return 1.0;\r\n  }else if(val > 0.1 && val < 0.5){\r\n    return 5.0;\r\n  }else{\r\n    return 6.0;\r\n  } ',1.0000,'SELECT MINE_AREA FROM mine_survey_info b WHERE 1=1 ',128),(12,'MINEGOAF_AREA','矿山地质灾害',1,'if(val < 0.001){\r\n		return 2.0;\r\n	}else if(val > 0.002 && val < 0.04){\r\n    return 12.0;\r\n  }else if(val > 0.04 && val < 0.1){\r\n    return 5.0;\r\n  }else{\r\n    return 1.0;\r\n  } ',1.0000,'SELECT MINEGOAF_AREA FROM mine_survey_info b WHERE 1=1 ',128);
